(1015, 1018, 'A calculation of the amount of oxygen-carrying hemoglobin inside RBCs. Since macrocytic RBCs are larger than either normal or microcytic RBCs, they would also tend to have higher MCH values.', 'en', 1, '2004-12-02 00:00:00', NULL, NULL, '8eedd317-08ab-11e5-b8b6-2089841041bc'),
(1016, 1019, 'A broad screening test to check for such disorders as anemia, infection, and many other diseases. Includes white blood cell count, red blood cell count, hemoglobin, hematocrit, indices (MCV, MCH, MCHC, RDW), and often includes platelet count.', 'en', 1, '2004-12-02 00:00:00', NULL, NULL, '8eedd5e5-08ab-11e5-b8b6-2089841041bc'),
(1017, 1020, 'Immature neutrophils with a crescent shaped nucleus, bands are normal in the circulation in small numbers. If there is a percentage increase of them, there is said to be a left shift. This may happen when an acute infection stimulates increased neutrophils production.', 'en', 1, '2004-12-02 00:00:00', NULL, NULL, '8eedd8a1-08ab-11e5-b8b6-2089841041bc'),
