(1292, 1298, 'Very Low Density Lipoprotein (VLDL) is one of three major lipoprotein particles.  VLDL contains the highest amount of triglyceride. Since VLDL contains most of the circulating triglyceride and since the compositions of the different particles are relatively constant, it is possible to estimate the amount of VLDL cholesterol by dividing the triglyceride value (in mg/dL) by 5.', 'en', 1, '2006-06-02 00:00:00', NULL, NULL, '8ef2f5f2-08ab-11e5-b8b6-2089841041bc'),
(1293, 1299, 'To diagnose pancreatitis or other pancreatic diseases', 'en', 1, '2006-06-05 00:00:00', NULL, NULL, '8ef30b9e-08ab-11e5-b8b6-2089841041bc'),
