(1300, 1307, 'Mean platelet volume (MPV) is a machine-calculated measurement of the average size of your platelets. New platelets are larger, and an increased MPV occurs when increased numbers of platelets are being produced. MPV gives your doctor information about platelet production in your bone marrow.', 'en', 1, '2006-06-06 00:00:00', NULL, NULL, '8ef34df1-08ab-11e5-b8b6-2089841041bc'),
(1301, 1308, 'A measurement derived from the platelet count and the mean platelet volume.', 'en', 1, '2006-06-06 00:00:00', NULL, NULL, '8ef350bb-08ab-11e5-b8b6-2089841041bc'),
(1302, 1309, 'Derived from direct flow cytometric measurement of platelet cell volume, it is increased in the presence of platelet anisocytosis.', 'en', 1, '2006-06-06 00:00:00', NULL, NULL, '8ef35353-08ab-11e5-b8b6-2089841041bc'),
(1303, 1310, 'Percentage of t-cells which express the CD3 surface receptor.', 'en', 1, '2006-06-06 00:00:00', NULL, NULL, '8ef35621-08ab-11e5-b8b6-2089841041bc'),
