(1307, 1327, 'Help determine if the bone marrow is responding adequately to the body?s need for RBCs and to help determine the cause of and classify different types of anemia.\r\n\r\nReticulocyte (%) = [Number of Reticulocytes / Number of Red Blood Cells] X 100', 'en', 1, '2006-06-09 00:00:00', NULL, NULL, '8ef360b9-08ab-11e5-b8b6-2089841041bc'),
(1308, 1328, 'Reactive, or atypical lymphocytes are lymphocytes that become large as a result of antigen stimulation. Typically they can be more than 30 ', 'en', 1, '2006-06-09 00:00:00', NULL, NULL, '8ef3635a-08ab-11e5-b8b6-2089841041bc'),
(1309, 1330, 'Absolute neutrophil count (ANC) is a measure of the number of neutrophil granulocytes (also known as polymorphonuclear cells, PMN''s, polys, granulocytes, segmented neutrophils or segs) present in the blood. Neutrophils are a type of white blood cell that fights against infection.\r\n\r\nANC = (%neutrophils + %bands) x WBC', 'en', 1, '2006-06-09 00:00:00', NULL, NULL, '8ef36624-08ab-11e5-b8b6-2089841041bc'),
(1310, 1331, 'A monocyte count is part of a complete blood count and is expressed by absolute numbers.  Increase a monocyte count include: - chronic inflammation - stress response - hyperadrenocorticism - immune mediated disease - pyogranulomatous disease - necrosis - red cell regeneration.\r\n', 'en', 1, '2006-06-09 00:00:00', NULL, NULL, '8ef3696f-08ab-11e5-b8b6-2089841041bc'),
(1311, 1332, 'Eosinophil granulocytes, commonly referred to as eosinophils (or less commonly as acidophils), are white blood cells that are responsible for combating infection by parasites in the body.\r\n\r\n', 'en', 1, '2006-06-09 00:00:00', NULL, NULL, '8ef36c46-08ab-11e5-b8b6-2089841041bc'),
(1312, 1333, 'Basophils are the least common of the granulocytes, representing about 0.5% to 1% of circulating leukocytes. ', 'en', 1, '2006-06-09 00:00:00', NULL, NULL, '8ef36f0b-08ab-11e5-b8b6-2089841041bc'),
(1313, 1334, 'Reactive, or atypical lymphocytes are lymphocytes that become large as a result of antigen stimulation. Typically they can be more than 30 ', 'en', 1, '2006-06-09 00:00:00', NULL, NULL, '8ef371be-08ab-11e5-b8b6-2089841041bc'),
(1314, 1336, 'Type of white blood cell which forms an early line of defence against bacterial infections by using microscopic exam', 'en', 1, '2006-06-09 00:00:00', NULL, NULL, '8ef37483-08ab-11e5-b8b6-2089841041bc'),
(1315, 1337, 'Immature neutrophils with a crescent shaped nucleus, bands are normal in the circulation in small numbers. If there is a percentage increase of them, there is said to be a left shift. This may happen when an acute infection stimulates increased neutrophils production.  This is a microscopic exam.', 'en', 1, '2006-06-09 00:00:00', NULL, NULL, '8ef3772e-08ab-11e5-b8b6-2089841041bc'),
(1316, 1338, 'Agranulocytic leukocyte that normally makes up about 25% of the total white blood cell count but increases in the presence of infection.  This is a microscopic exam.', 'en', 1, '2006-06-09 00:00:00', NULL, NULL, '8ef37a05-08ab-11e5-b8b6-2089841041bc'),
(1317, 1339, 'Large, circulating, phagocytic white blood cells, having a single well-defined nucleus and very fine granulation in the cytoplasm. Monocytes constitute from 3 to 8 percent of the white blood cells in humans.  This is a microscopic exam.', 'en', 1, '2006-06-09 00:00:00', NULL, NULL, '8ef37cd7-08ab-11e5-b8b6-2089841041bc'),
(1318, 1340, 'A type of white blood cell found in vertebrate blood, containing cytoplasmic granules that are easily stained by eosin or other acid dyes.  This is a microscopic exam.', 'en', 1, '2006-06-09 00:00:00', NULL, NULL, '8ef37f8a-08ab-11e5-b8b6-2089841041bc'),
(1319, 1341, 'Type of leukocyte, with coarse granules that stain blue when exposed to a basic dye. Basophils normally constitute 1% or less of the total white blood cell count but may increase or decrease in certain diseases.  This is a microscopic exam.', 'en', 1, '2006-06-09 00:00:00', NULL, NULL, '8ef38278-08ab-11e5-b8b6-2089841041bc'),
(1320, 1342, 'Body Mass Index (BMI) is a relationship between weight and height that is associated with body fat and health risk.\r\n\r\nThe equation is BMI = body weight in kilograms/height in meters squared.', 'en', 1, '2006-07-13 00:00:00', NULL, NULL, '8ef38699-08ab-11e5-b8b6-2089841041bc'),
(1321, 1343, 'MUAC is the circumference of the left upper arm, measured at the mid-point between the tip of the shoulder and the tip of the elbow.  MUAC is useful for the assessment of nutritional status.', 'en', 1, '2006-07-13 00:00:00', NULL, NULL, '8ef38c11-08ab-11e5-b8b6-2089841041bc'),
