('patient.identifierPrefix', '', 'This property is only used if patient.identifierRegex is empty.  The string here is prepended to the sql indentifier search string.  The sql becomes "... where identifier like ''<PREFIX><QUERY STRING><SUFFIX>'';".  Typically this value is either a percent sign (%) or empty.', '8f72a5ae-08ab-11e5-b8b6-2089841041bc', NULL, NULL, NULL, NULL),
('patient.identifierRegex', '', 'WARNING: Using this search property can cause a drop in mysql performance with large patient sets.  A MySQL regular expression for the patient identifier search strings.  The @SEARCH@ string is replaced at runtime with the user''s search string.  An empty regex will cause a simply ''like'' sql search to be used. Example: ^0*@SEARCH@([A-Z]+-[0-9])?$', '8f72a921-08ab-11e5-b8b6-2089841041bc', NULL, NULL, NULL, NULL),
('patient.identifierSearchPattern', NULL, 'If this is empty, the regex or suffix/prefix search is used.  Comma separated list of identifiers to check.  Allows for faster searching of multiple options rather than the slow regex. e.g. @SEARCH@,0@SEARCH@,@SEARCH-1@-@CHECKDIGIT@,0@SEARCH-1@-@CHECKDIGIT@ would turn a request for "4127" into a search for "in (''4127'',''04127'',''412-7'',''0412-7'')"', '11ed00a8-008e-4216-8d80-7702975aa10c', NULL, NULL, NULL, NULL),
('patient.identifierSuffix', '', 'This property is only used if patient.identifierRegex is empty.  The string here is prepended to the sql indentifier search string.  The sql becomes "... where identifier like ''<PREFIX><QUERY STRING><SUFFIX>'';".  Typically this value is either a percent sign (%) or empty.', '8f72ac13-08ab-11e5-b8b6-2089841041bc', NULL, NULL, NULL, NULL),
