('patient.nameValidationRegex', '^[a-zA-Z \\-]+$', 'Names of the patients must pass this regex. Eg : ^[a-zA-Z \\-]+$ contains only english alphabet letters, spaces, and hyphens. A value of .* or the empty string means no validation is done.', '089436ee-e4b1-414d-af41-99f5fabd1f9e', NULL, NULL, NULL, NULL),
