('patient_identifier.importantTypes', '', 'A comma delimited list of PatientIdentifier names : PatientIdentifier locations that will be displayed on the patient dashboard.  E.g.: TRACnet ID:Rwanda,ELDID:Kenya', '8f72b675-08ab-11e5-b8b6-2089841041bc', NULL, NULL, NULL, NULL),
('person.attributeSearchMatchMode', 'EXACT', 'Specifies how person attributes are matched while searching person. Valid values are ''ANYWHERE'' or ''EXACT''. Defaults to exact if missing or invalid value is present.', 'dc66b1e3-6baf-4c9f-abf3-b66aa7cd22b5', NULL, NULL, NULL, NULL),
('person.searchMaxResults', '1000', 'The maximum number of results returned by patient searches', '8f72b15f-08ab-11e5-b8b6-2089841041bc', NULL, NULL, NULL, NULL),
('PersonAttributeType.locked', 'false', 'Set to a value of true if you do not want allow editing person attribute types, else set to false.', '30d1a274-f012-4625-8334-fe76786161ac', NULL, NULL, NULL, NULL),
('provider.unknownProviderUuid', NULL, 'Specifies the uuid of the Unknown Provider account', '811924e1-045d-4307-9052-bad240c76746', NULL, NULL, NULL, NULL),
('providerSearch.matchMode', 'EXACT', 'Specifies how provider identifiers are matched while searching for providers. Valid values are START,EXACT, END or ANYWHERE', 'c20d8895-fd51-450a-96f6-4364c92b0030', NULL, NULL, NULL, NULL),
('report.xmlMacros', '', 'Macros that will be applied to Report Schema XMLs when they are interpreted. This should be java.util.properties format.', '8f72b8f3-08ab-11e5-b8b6-2089841041bc', NULL, NULL, NULL, NULL),
('reportProblem.url', 'http://errors.openmrs.org/scrap', 'The openmrs url where to submit bug reports', 'a01328a4-9c94-4e4b-8802-af7796a5a1b0', NULL, NULL, NULL, NULL),
('scheduler.password', 'test', 'Password for the OpenMRS user that will perform the scheduler activities', '2eaf60e4-b01f-4f4f-b5be-25bd9961820d', NULL, NULL, NULL, NULL),
('scheduler.username', 'admin', 'Username for the OpenMRS user that will perform the scheduler activities', 'ec8b22b8-d7ba-4901-a9ef-eb39b240b5c4', NULL, NULL, NULL, NULL),
('search.caseSensitiveDatabaseStringComparison', 'true', 'Indicates whether database string comparison is case sensitive or not. Setting this to false for MySQL with a case insensitive collation improves search performance.', '6d3bc180-d19f-486b-abf4-0b4a98bd699b', NULL, NULL, NULL, NULL),
('search.indexVersion', '3', 'Indicates the index version. If it is blank, the index needs to be rebuilt.', '581d3a65-64d4-48e9-a425-94c7bec7026d', NULL, NULL, NULL, NULL),
('searchWidget.batchSize', '200', 'The maximum number of search results that are returned by an ajax call', 'bf95d4d4-daaa-4466-89c2-29bb3008809e', NULL, NULL, NULL, NULL),
('searchWidget.dateDisplayFormat', NULL, 'Date display format to be used to display the date somewhere in the UI i.e the search widgets and autocompletes', 'dcd862af-a393-47c7-a99d-a22f5912a54e', NULL, NULL, NULL, NULL),
('searchWidget.maximumResults', '2000', 'Specifies the maximum number of results to return from a single search in the search widgets', '5bdd08f7-a6df-4d91-8ea1-94011f1ee3c5', NULL, NULL, NULL, NULL),
('searchWidget.runInSerialMode', 'false', 'Specifies whether the search widgets should make ajax requests in serial or parallel order, a value of true is appropriate for implementations running on a slow network connection and vice versa', 'd835ce4c-7d50-4591-b890-9ad5eff8d9c4', 'org.openmrs.customdatatype.datatype.BooleanDatatype', NULL, NULL, NULL),
('searchWidget.searchDelayInterval', '300', 'Specifies time interval in milliseconds when searching, between keyboard keyup event and triggering the search off, should be higher if most users are slow when typing so as to minimise the load on the server', '1ef4d6bf-40dd-4f4a-b412-f08d47379b91', NULL, NULL, NULL, NULL),
('security.allowedFailedLoginsBeforeLockout', '7', 'Maximum number of failed logins allowed after which username is locked out', '9fd2475b-130e-46cf-81cb-b728c4352498', NULL, NULL, NULL, NULL),
('security.passwordCannotMatchUsername', 'true', 'Configure whether passwords must not match user''s username or system id', 'fef37fe9-be14-438d-93cc-c1e6e6f6e0f8', 'org.openmrs.customdatatype.datatype.BooleanDatatype', NULL, NULL, NULL),
('security.passwordCustomRegex', NULL, 'Configure a custom regular expression that a password must match', 'ee51863d-729c-4742-b0ee-8992041398d4', NULL, NULL, NULL, NULL),
('security.passwordMinimumLength', '8', 'Configure the minimum length required of all passwords', '4ec7eae4-3ba8-4fc8-88fc-7d53141995e8', NULL, NULL, NULL, NULL),
('security.passwordRequiresDigit', 'true', 'Configure whether passwords must contain at least one digit', '7628868d-f7a9-4c76-bd92-ad2e95d287dc', 'org.openmrs.customdatatype.datatype.BooleanDatatype', NULL, NULL, NULL),
('security.passwordRequiresNonDigit', 'true', 'Configure whether passwords must contain at least one non-digit', 'c2d98a4e-970f-49b1-908e-5b0038edf188', 'org.openmrs.customdatatype.datatype.BooleanDatatype', NULL, NULL, NULL),
('security.passwordRequiresUpperAndLowerCase', 'true', 'Configure whether passwords must contain both upper and lower case characters', '97a076bd-a4d1-40f0-966b-d5fc28869baa', 'org.openmrs.customdatatype.datatype.BooleanDatatype', NULL, NULL, NULL),
('user.headerAttributeTypes', NULL, 'A comma delimited list of PersonAttributeType names that will be shown on the user dashboard. (not used in v1.5)', '5a0e87ef-28ac-4c99-8b2d-cb727a673f57', NULL, NULL, NULL, NULL),
('user.listingAttributeTypes', '', 'A comma delimited list of PersonAttributeType names that should be displayed for users in _lists_', '8f72c00a-08ab-11e5-b8b6-2089841041bc', NULL, NULL, NULL, NULL),
('user.requireEmailAsUsername', 'false', 'Indicates whether a username must be a valid e-mail or not.', 'dd84678d-af47-4a84-8d38-2f8e71b29966', 'org.openmrs.customdatatype.datatype.BooleanDatatype', NULL, NULL, NULL),
('user.viewingAttributeTypes', '', 'A comma delimited list of PersonAttributeType names that should be displayed for users when _viewing individually_', '8f72c96e-08ab-11e5-b8b6-2089841041bc', NULL, NULL, NULL, NULL),
('use_patient_attribute.healthCenter', 'false', 'Indicates whether or not the ''health center'' attribute is shown when viewing/searching for patients', '8f72cbfe-08ab-11e5-b8b6-2089841041bc', 'org.openmrs.customdatatype.datatype.BooleanDatatype', NULL, NULL, NULL),
('use_patient_attribute.mothersName', 'false', 'Indicates whether or not mother''s name is able to be added/viewed for a patient', '8f72ce8d-08ab-11e5-b8b6-2089841041bc', 'org.openmrs.customdatatype.datatype.BooleanDatatype', NULL, NULL, NULL),
('use_patient_attribute.tribe', 'true', 'Indicates whether or not the ''tribe'' attribute is shown when viewing/searching for patients', '8f72d1b9-08ab-11e5-b8b6-2089841041bc', NULL, NULL, NULL, NULL),
('visits.allowOverlappingVisits', 'true', 'true/false whether or not to allow visits of a given patient to overlap', '69be773e-c011-4b35-bb9d-952390ccb530', 'org.openmrs.customdatatype.datatype.BooleanDatatype', NULL, NULL, NULL),
('visits.assignmentHandler', 'org.openmrs.api.handler.ExistingVisitAssignmentHandler', 'Set to the name of the class responsible for assigning encounters to visits.', 'c676e9fe-369a-4810-8203-c63cd8c8d41f', NULL, NULL, NULL, NULL),
('visits.autoCloseVisitType', NULL, 'comma-separated list of the visit type(s) to automatically close', 'd89bb855-77db-4ec1-ad6b-00ef8b47fd37', NULL, NULL, NULL, NULL),
('visits.enabled', 'true', 'Set to true to enable the Visits feature. This will replace the ''Encounters'' tab with a ''Visits'' tab on the dashboard.', 'd86bc379-74c7-4697-9e99-39fcc674ed4b', 'org.openmrs.customdatatype.datatype.BooleanDatatype', NULL, NULL, NULL),
('visits.encounterTypeToVisitTypeMapping', NULL, 'Specifies how encounter types are mapped to visit types when automatically assigning encounters to visits. e.g 1:1, 2:1, 3:2 in the format encounterTypeId:visitTypeId or encounterTypeUuid:visitTypeUuid or a combination of encounter/visit type uuids and ids e.g 1:759799ab-c9a5-435e-b671-77773ada74e4', '5572226f-fd44-4a67-9d46-38b41a22dcdc', NULL, NULL, NULL, NULL),
('webservices.rest.allowedips', NULL, 'A comma-separate list of IP addresses that are allowed to access the web services. An empty string allows everyone to access all ws. \n        IPs can be declared with bit masks e.g. 10.0.0.0/30 matches 10.0.0.0 - 10.0.0.3 and 10.0.0.0/24 matches 10.0.0.0 - 10.0.0.255.', 'a8201de0-16a5-4a09-86a5-98fc35e88892', NULL, NULL, NULL, NULL),
('webservices.rest.mandatory', 'false', 'true/false whether or not the webservices.rest module MUST start when openmrs starts.  This is used to make sure that mission critical modules are always running if openmrs is running.', '5879b857-61dc-4391-a362-d1c5e0432ed4', NULL, NULL, NULL, NULL),
('webservices.rest.maxResultsAbsolute', '100', 'The absolute max results limit. If the client requests a larger number of results, then will get an error', '00ce0edb-b099-4ba5-a807-74ec496ca828', NULL, NULL, NULL, NULL),
('webservices.rest.maxResultsDefault', '50', 'The default max results limit if the user does not provide a maximum when making the web service call.', 'a0b61cc6-8770-4a55-9525-9f026ff48e55', NULL, NULL, NULL, NULL),
('webservices.rest.started', 'true', 'DO NOT MODIFY. true/false whether or not the webservices.rest module has been started.  This is used to make sure modules that were running  prior to a restart are started again', '20e97ca4-2038-4a48-b27b-11bf662908b5', NULL, NULL, NULL, NULL),
('webservices.rest.uriPrefix', 'openmrs', 'The URI prefix through which clients consuming web services will connect to the web application, should be of the form http://{ipAddress}:{port}/{contextPath}', '0baa1512-d272-469b-bb44-e3d5f6866d2d', NULL, NULL, NULL, NULL);
